window.bookSummaryJSON = "<p>She wants revenge. He wants her.</p> <p>Blackballed from underwater archaeology after accusations of artifact trafficking, Erica Kesling has a new job and a new life on the other side of the country and is working to clear her name. She's closing in on her goal when she's distracted by a sexy, charismatic intern who makes her want something other than revenge. But Lee Scott is no intern. He's looking for the lead conspirator in an international artifact smuggling scheme, and Erica is his prime suspect. He'll do whatever it takes to win her trust and get her to reveal her secrets, even seduce her.</p>"; 
